import React, { useState } from "react";
import img from "../../components/img/Screen Shot 2023-06-14 at 11.45 2.png";
import img2 from "../../components/img/We all need a little help sometimes.png";
import { Link } from "react-router-dom";
import LocationMap from "../../components/location/LocationMap";
import "./home.css";

export default function Home1() {
  const [searchText, setSearchText] = useState("");

  const handleSearch = () => {
    console.log("Search Address:", searchText);
  };

  return (
    <>
      <div className="topleft">
        <Link to="/">
          <img className="img2" src={img2} alt="Image" />
        </Link>
        <Link to="/">
          <img className="img" src={img} alt="Image" />
        </Link>
      </div>
      <div className="home">
        <div className="images-container">
          <img src="image 6.png" alt="Image 1" className="image" />
          <img src="image 7.png" alt="Image 2" className="image" />
          <img src="image3.jpg" alt="Image 3" className="image" />
        </div>
        <div className="search-box">
          <input
            type="text"
            value={searchText}
            onChange={(e) => setSearchText(e.target.value)}
            placeholder="Enter an address"
            className="search-input"
          />
          <button className="search-button" onClick={handleSearch}>Search</button>
        </div>
        <LocationMap />
      </div>
    </>
  );
}
